import React from "react";
import {Image, Popup, Rating, Button} from 'semantic-ui-react';

function element(props){
    const navigate =()=>{
        console.log(props.data.link);
    }
    let src='../img/elements/';
    return(
        
        <div id="element">
            <Popup
                trigger={<Image  src={src + props.data.img} size="tiny"></Image>}
                on='click'
                hideOnScroll>
                <Popup.Content>
                        <span>
                        <h3>{props.data.name}</h3>
                        <p className="pp">{props.data.text}</p>
                        <Rating defaultRating={props.data.rate} maxRating={5} disabled />
                        <div  className="btn_nav"><Button circular size="mini" icon="linkify" onClick={navigate} /></div>
                        </span>
                </Popup.Content>
            </Popup>
        </div>
    )
}


export default element;
